import { icon } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import React from 'react';
import "./HistoryIcon.css";
const historyIcon={
    music: "music",
    play: "play-circle",
    different:"ellipsis-h",
}
function HistoryIcon() {
    return (
      <>
          <div className="HistoryIcon">
                    <a href="123" className="history-link-icon">
                        <FontAwesomeIcon className="HistoryIcon" icon={['fab','{historyIcon.music}' ]}/>
                    </a>
                    <a href="123" className="history-link-icon">
                        <FontAwesomeIcon className="HistoryIcon" icon={historyIcon.play}/>
                    </a>
                    <a href="123" className="history-link-icon">
                        <FontAwesomeIcon className="HistoryIcon" icon={historyIcon.diffent}/>
                    </a>
                </div>
      </>
    );
  }
export default HistoryIcon;
